VALUES ('8594027773129', 'rýžová Quinoa', 'RYŽOVAUINUA Y MLECNE COKOLADE (CZ) Pufovaná rýžová tyčinka s quinoou v mléčné čokoládě. Hmotnost (8 g. Složení: mléčná čokoláda 55 % (cukr, Kakaové máslo, sušené plnotučné mléko, kakaová hmota, sušená syrovátka laktóza, emulgátory: Sójový lecitin, polyglycerolpolyricinoleát aroma), pufovaná rýžová tyčinka s quinoou 45 % (rý290 %, quinoa 10%, emulgátor:sójový leciun) Obsah kakaové sušiny v mléčné čokoládě mínimálně 31 %.Výrobek můžeobsahovat stopy lepku, arašidu a Skorapkových plodů. (S) Pufovaná ryžová tyčinkas quinoou v mliečnej čokoede.Hmotnost: 18 g.Zioženie: mliecn čokoláda 55% (cukor, kakaové maslo, sušené pinotučné mlieko, kakaová hmota, susená srvatka, laktoza, emulgatory Sojoy lecitin, polyglycerolpolyricinoleat aróma), pufovaná ryzová tyčinka s quinoou 45 %(ža 90 %,quinoa 10% emuloátor sojovy lecitin). Obsah kakaovej susineymecnej cokolade najmenej 31 %. ýro k echsab arašidy a škrupinové plody.', 'https://static.openfoodfacts.org/images/products/859/402/777/3129/front_cs.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

